import { fromJS } from 'immutable'
import * as actions from 'actions/detail'

export default (state = fromJS(initState), action) => {
  switch (action.type) {
    case actions.UPDATE_GOODS_DETAIL:
      return state.merge({list: action.payload})
    default:
      return state
  }
}

